    private static function _getRules($codeType, $func)
    {
        $ruleName = $codeType . '_' . $func;
        if (!isset(self::$emojiRules[$ruleName])) {
            self::$emojiRules[$ruleName] = array_flip(self::$emojiRules[$codeType . '_encode']);
        }
        return self::$emojiRules[$ruleName];
    }

    private static function _codeConvert($string, $codeType, $func)
    {
        $encodeRules = self::_getRules($codeType, $func);
        return str_replace(array_keys($encodeRules), $encodeRules, $string);
    }

    public static function encode($string)
    {
        return self::input($string);
        return self::_codeConvert($string, 'bbcode', 'encode');
    }

    public static function decode($code)
    {
        return self::output($code);
        return self::_codeConvert($code, 'bbcode', 'decode');
    }

    public static function encodeFromHtml($htmlStr)
    {
        return self::_codeConvert($htmlStr, 'html', 'encode');
    }

    public static function decodeToHtml($code)
    {
        return self::_codeConvert($code, 'html', 'decode');
    }

    public static function input($str)
    {
        $wordList = preg_split("//u", $str, -1, PREG_SPLIT_NO_EMPTY);
        for ($i = 0; $i < count($wordList); $i++) {
            strlen($wordList[$i]) == 4 && $wordList[$i] = "[emoji]"
                . ltrim(bin2hex(mb_convert_encoding($wordList[$i], 'UCS-4', mb_internal_encoding())), 0)
                . "[/emoji]";
        }

        return implode("", $wordList);
    }

    public static function output($str)
    {
        $formatRes = preg_replace_callback("/\[emoji\]([\w]+)\[\/emoji\]/i", function ($matches) {
            return mb_convert_encoding(implode("", array_map(function ($val) {
                return hex2bin(str_pad($val, 8, 0, STR_PAD_LEFT));
            }, str_split($matches[1], 5))), mb_internal_encoding(), "UCS-4");
        }, $str);
        /**
         * 去除调转换失败的字符
         */
        $formatRes = preg_replace(
            ["/\[emoji\]([\w]+)\[\/emoji\]/", "/\[.*$/"],
            ['', ''],
            $formatRes
        );
        return $formatRes;
    }
